uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Uniforms from JSON
uniform float u_speed;
uniform float u_bloom;
uniform float u_grain;
uniform float u_vignette;
uniform float u_flicker;
uniform float u_distort;

out vec4 fragColor;

// --- Helper Functions ---

float hash(vec2 p) {
    p = fract(p * vec2(123.34, 456.21));
    p += dot(p, p + 45.32);
    return fract(p.x * p.y);
}

mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Distance to a 2D line segment
float sdSegment(vec2 p, vec2 a, vec2 b) {
    vec2 pa = p - a, ba = b - a;
    float h = clamp(dot(pa, ba) / dot(ba, ba), 0.0, 1.0);
    return length(pa - ba * h);
}

// Simple procedural noise for texture/flicker
float noise(vec2 p) {
    vec2 i = floor(p);
    vec2 f = fract(p);
    f = f * f * (3.0 - 2.0 * f);
    float a = hash(i);
    float b = hash(i + vec2(1.0, 0.0));
    float c = hash(i + vec2(0.0, 1.0));
    float d = hash(i + vec2(1.0, 1.0));
    return mix(mix(a, b, f.x), mix(c, d, f.x), f.y);
}

// --- Stranger Things Typography "Logic" ---
// We'll approximate the "ST" boxy/serif aesthetic using signed distance segments
float strangerLogo(vec2 uv) {
    uv.y += 0.05; // Slight offset for framing
    float d = 1e10;

    // Scale and position adjustment for the letters
    vec2 p = uv * 1.8;

    // Top Bar (The Iconic Red Line)
    d = min(d, sdSegment(p, vec2(-0.8, 0.45), vec2(0.8, 0.45)));

    // Abstract "S" Shape
    d = min(d, sdSegment(p, vec2(-0.6, 0.4), vec2(-0.3, 0.4)));
    d = min(d, sdSegment(p, vec2(-0.6, 0.4), vec2(-0.6, 0.1)));
    d = min(d, sdSegment(p, vec2(-0.6, 0.1), vec2(-0.3, 0.1)));
    d = min(d, sdSegment(p, vec2(-0.3, 0.1), vec2(-0.3, -0.2)));
    d = min(d, sdSegment(p, vec2(-0.3, -0.2), vec2(-0.6, -0.2)));

    // Abstract "T" Shape
    d = min(d, sdSegment(p, vec2(0.1, 0.4), vec2(0.6, 0.4)));
    d = min(d, sdSegment(p, vec2(0.35, 0.4), vec2(0.35, -0.2)));

    // Side bars
    d = min(d, sdSegment(p, vec2(-0.8, 0.45), vec2(-0.8, 0.1)));
    d = min(d, sdSegment(p, vec2(0.8, 0.45), vec2(0.8, 0.1)));

    return d;
}

void main() {
    // 1. Setup Coordinates
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float time = iTime * u_speed;

    // 2. Lens Distortion
    float r2 = dot(uv, uv);
    uv *= 1.0 + r2 * u_distort * 0.5;

    // 3. Subtle Camera Shake (The Upside Down vibe)
    vec2 shake = vec2(noise(vec2(time * 2.0, 0.0)), noise(vec2(0.0, time * 2.0))) - 0.5;
    uv += shake * 0.005;

    // 4. Logo Field
    float dist = strangerLogo(uv);

    // Create the "Glowy Red" neon effect
    float thickness = 0.008;
    float edge = 0.002;
    float mask = smoothstep(thickness + edge, thickness, dist);

    // Volumetric glow
    float glow = exp(-dist * 12.0) * 0.6;
    glow += exp(-dist * 40.0) * 1.5;
    glow += exp(-dist * 120.0) * 2.0;

    // 5. Colors (Iconic Retro Red)
    vec3 redColor = vec3(0.9, 0.05, 0.02);
    vec3 accentColor = vec3(1.0, 0.2, 0.1);

    // 6. Flickering Light Logic
    float flicker = 1.0 - (noise(vec2(time * 10.0)) * u_flicker);
    if (noise(vec2(time * 0.5)) > 0.98) flicker *= 0.2; // Occasional deep flicker

    vec3 finalColor = redColor * mask;
    finalColor += accentColor * glow * u_bloom;
    finalColor *= flicker;

    // 7. Background Atmosphere (The Void / Upside Down)
    float bgNoise = noise(uv * 4.0 + time * 0.2);
    finalColor += vec3(0.02, 0.01, 0.01) * bgNoise;

    // Floating dust particles
    vec2 dustUV = uv * 20.0;
    float particles = pow(noise(dustUV + time * 0.1), 10.0);
    finalColor += particles * vec3(0.5, 0.3, 0.2) * 0.5;

    // 8. Film Grain
    float grain = hash(uv + time) * u_grain;
    finalColor += grain;

    // 9. Vignette
    float vignette = 1.0 - length(uv * 0.8);
    vignette = pow(vignette, u_vignette * 2.0);
    finalColor *= vignette;

    // 10. Color Grading (Retro Contrast)
    finalColor = pow(finalColor, vec3(0.9)); // Slight gamma adjustment
    finalColor = mix(finalColor, finalColor * finalColor * (3.0 - 2.0 * finalColor), 0.2); // Soft contrast

    fragColor = vec4(finalColor, 1.0);
}
